def is_prime(n):
    if n < 1:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    i = 3
    while i * i <= n:
        if n % i == 0:
            return False
        i += 2
    return True

def solve(n):
    sum_primes = 0
    smallest_odd_prime = None
    for i in range(2, n + 1):
        if is_prime(i):
            sum_primes += i ** 5
            if smallest_odd_prime is None and i % 2 != 0:
                smallest_odd_prime = i
    if sum_primes % 2 != 0:
        return (sum_primes, smallest_odd_prime)
    else:
        return (sum_primes,)

